ders use bikes differently?\n","2. Why would casual riders buy Cyclistic memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","**Key tasks:**\n","1. Identify the business task: \n","- Convert more casual riders into member riders to maximize profit.\n","2. Consider key stakeholders:\n","- Lily Moreno (Director of Marketing), Cyclistic executive team, Cyclistic marketing analytics team. \n"," \n","# PREPARE\n","\n","I will use Cyclistic’s historical trip data to analyze and identify trends. The data has been made available by Motivate International Inc. under this [license](http://https://divvybikes.com/data-license-agreement). Datasets are available [here](http://https://divvy-tripdata.s3.amazonaws.com/index.html).\n","\n","**Key tasks:**\n","1. Download data and store it approriately: \n","- The data is downloaded in .zip format, extracted, and stored in a separate folder named “Cyclistic Data” on my computer.\n","2. Identify how it's organized: \n","- All trip data is in .csv format. Column names \"ride_id\", \"rideable_type\", \"started_at\", \"ended_at\", \"start_station_name\", \"start_station_id\", \"end_station_name\", \"end_station_id\", \"start_lat\", \"start_lng\", \"end_lat\", \"end_lng\", \"member_casual\"\n","3. Sort and filter the data:\n","- Trips that did not include a start or end date are excluded.\n","- Trips greater than 24 hours in duration are excluded.\n","- Trips less than 1 minute in duration are excluded."]},{"cell_type":"code","execution_count":2,"id":"3e9853f9","metadata":{"execution":{"iopub.execute_input":"2024-06-20T22:15:52.192563Z","iopub.status.busy":"2024-06-20T22:15:52.160381Z","iopub.status.idle":"2024-06-20T22:15:58.862913Z","shell.execute_reply":"2024-06-20T22:15:58.860946Z"},"papermill":{"duration":6.722439,"end_time":"2024-06-20T22:15:58.865702","exception":false,"start_time":"2024-06-20T22:15:52.143263","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","outp